import React from 'react';
import './ArrayBars.css';

const ArrayBars = ({ array }) => {
  return (
    <div className="array-bars-container">
      {array.map((value, index) => (
        <div
          className="array-bar"
          key={index}
          style={{ height: `${value}px` }}
        ></div>
      ))}
    </div>
  );
};

export default ArrayBars;
